import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

import List from "./components/List";
import Home from "./components/Home";
import Search from "./components/Search";
import {ContextProvider} from "./components/Context"



export default function App(){

    return(
<div>
    <ContextProvider>
        <Router>
            <nav>
                <Link style={{ textDecoration: 'none' }} to={"/"}>Home</Link>
                <Link style={{ textDecoration: 'none' }} to={'/Search'}>Search</Link>
                <Link style={{ textDecoration: 'none' }} to={"/List"}>List</Link>
            </nav>

            <div>
            <Routes>
                <Route path='/' element= {<Home/>}/>
                <Route path='/Search' element= {<Search/>}/>
                <Route path='/List' element= {<List/>}/>
        </Routes>
            </div>


        </Router>
    </ContextProvider>

     <footer> 
        <span>WebSite created by Nicholas Bielecki. </span>
        <span className="fontAwesome">
            <a href="https://github.com/NicholasBielecki/SchoolProjects"><i class="fa-brands fa-github fa-2x"></i></a>
            <a><i class="fa-brands fa-linkedin fa-2x"></i> </a>
            <a><i class="fa-brands fa-google fa-2x"></i></a>
        </span>
      </footer>


</div>
    )
}



